import { Maverick } from "./MyReact.js";
/** @jsx.Maverick.createElement */

function test() {
  const [state, setState] = Maverick.useState(0);
  const counter = Maverick.createElement(
    "h1",
    {
      onclick: setState((c) => c + 1),
    },
    `${{ state }}`
  );
  return counter;
}

const count = test;
const container = document.getElementById("root");
Maverick.render(count, container);
